                billiards? From billiards to climbing walls to gem mines, 
                the listings below will help you find all the entertainment 
                and amusements you need for a fun-filled day in Boone.
            </Typography>

            <HighLanes />
            <Billiards />
            <FunWheels />
            <HickoryMuseum />
            <SpeedWay />
            <Mysterium />
            <OffRoad />
            <Regal />
            <MiniGolf />

        </Fragment>
    );
}

export default EnA;
